import React from 'react'
import Footer from '../components/UI/Footer/Footer';
import Navbar from '../components/UI/Navbar/Navbar';

const AboutUs = () => {
  return (
    <div>
      <header>
        <Navbar/>
      </header>
      <footer>
        <Footer />
      </footer>
    </div>
  );
};

export default AboutUs;
